import React, { useRef } from "react";

export default function SearchBar() {
  const searchFiltersRef = useRef(null);

  const handleClick = () => {
    if (searchFiltersRef.current) {
      searchFiltersRef.current.style.marginTop = "-100dvh";
    }
  };

  return (
    <div className="search-bar">
      <h3>BestSpot</h3>
      <div className="search-bar-text" onClick={handleClick}>
        Search Here <i class="fa-solid fa-magnifying-glass"></i>
      </div>
    </div>
  );
}
